    val newX = location._1 + direction match {
      case "north" => location._1 - movementSpeed
      case "south" => location._1 + movementSpeed
      case "east" => location._2 + movementSpeed
      case "west" => location._2 - movementSpeed
      case _ => throw new Exception("Invalid direction")
    }
    val newY = location._2
    if (newX >= 0 && newX < 10 && newY >= 0 && newY < 10) {
      location = (newX, newY)
      energy -= 1
      true
    } else {
      false
    }
  }

