function sumOfDistinctSums(nums) {
    const numSet = new Set(nums);
    let sum = 0;

    for (let num of numSet) {
        let complement = numSet.has(0 - num) ? 0 : 0 - num;
        sum += num + complement;
        numSet.delete(complement);
    }

    return sum;
