	"golang.org/x/net/html"
)

type Dish struct {
	Name  string `json:"name"`
	Description string `json:"description"`
}

var dishes []Dish

func main() {
	http.HandleFunc("/dishes", func(w http.ResponseWriter, r *http.Request) {
		if r.Method == "GET" {
			dishesJSON, err := ioutil.ReadFile("dishes.json")
			if err != nil {
				http.Error(w, err.Error(), http.StatusInternalServerError)
				return
			}
			var dishes []Dish
			err = json.Unmarshal(dishesJSON, &dishes)
			if err != nil {
				http.Error(w, err.Error(), http.StatusInternalServerError)
				return
			}
			for _, dish := range dishes {
				fmt.Fprint(w, "<div class='dish'>")
				fmt.Fprintf(w, "<h2>%s</h2>", dish.Name)
				fmt.Fprint(w, "<p>%s</p>", dish.Description)
				fmt.Fprint(w, "</div>")
			}
		} else {
			http.Error(w, "Invalid request method", http.StatusBadRequest)
		}
	})

	http.HandleFunc("/dishes/show", func(w http.ResponseWriter, r *http.Request) {
		if r.Method == "GET" {
			dishName := r.URL.Query().Get("name")
			for _, dish := range dishes {
				if strings.EqualFold(dish.Name, dishName) {
					fmt.Fprint(w, "<h2>%s</h2><p>%s</p>", dish.Name, dish.Description)
